import React from 'react';
import './home.css';
import { Link, Outlet} from 'react-router-dom';



export const Home = () => {
  return (
    <div>
        <div className='Loginpage'>
        <nav>
          <div className='header-content'>
          <li><Link to="lo" className='link'>Login</Link></li>
          <li><Link to="/" className='link'>About</Link></li>
          </div>
        </nav>
        </div>
  <Outlet/>
    </div>
  )
}
export default Home;
